import React, { Component } from 'react';
// components
import BookList from './components/BookList';
class App extends Component {
  render(){
  const props = {
    bookName: String
  }
    return (
      <div id="main">
        <h1>Reading List</h1>
         <BookList bookName={this.props.bookName}/>
      </div>
    );
  }
}

export default App;
